import React from "react";
import background from "./media/background.svg";

function App() {
  return (
    <div class="containter-fluid  bg-sea-green">
        <img src={background} style={{position:"absolute", width: "100%", height: "100%"}} alt="background" />
        <div class="d-flex flex-column align-items-center align-self-center my-auto">
            <div class="mx-auto" style={{position:"absolute", top:"40%"}}>
                <p class="text-center text-main my-n2">max pinheiro</p>
                <p class="text-center text-header">web developer</p>
            </div>
        </div>
    </div>
  );
}

export default App;
